#nullable enable // autogenerated

using MVZ2.GameContent.Enemies;
using PVZEngine.Definitions;
using PVZEngine.Level;

namespace MVZ2.GameContent.Spawns
{
    [SpawnDefinition(VanillaSpawnNames.undeadFlyingObjectBlitz)]
    public class UFOBlitzSpawnDefinition : VanillaSpawnDefinition
    {
        public UFOBlitzSpawnDefinition(string nsp, string name) : base(nsp, name)
        {
            var preview = new SpawnPreviewBehaviour();
            var inLevel = new UFOSpawnInLevelBehaviour(1, 20);
            var endless = new SpawnEndlessBehaviour();
            SetBehaviours(inLevel, preview, endless);
        }
    }
}
